import Elhelmet from "../../components/Elhelmet/Elhelmet";
import Carrusel from "../../components/Carrusel/Carrusel";
import "./Inicio.css";

function Inicio() {
	return (
		<>
			<Helmet>
				<title>{title} || { NOMBRETIENDA }</title>
			</Helmet>
			<section id="inicio">
				<Carrusel />
			</section>
		</>
	);
}
export default Inicio;
